import React from 'react';
import { Routes, Route } from 'react-router-dom';
import PollsPage from '../pages/PollsPage';

const AppRoutes = () => {
  return (
    <Routes>
      <Route path="/" element={<PollsPage />} />
    </Routes>
  );
};

export default AppRoutes;
